        # for idx, i in enumerate(s):
        #     common_str = ''
        #     for j in s[idx:]:
        #         if j in common_str:
        #             break
        #         common_str += j
        #
        #     long = len(common_str)
        #     if long > longest_num:
        #         longest_num = long
        #         longest_str = common_str
        #
        # return longest_num, longest_str

        # 2) Use list -> Time Limit Exceeded

        # def find_longest_substring(idx):
        #     common_list = []
        #     string = s[idx:]
        #     for i in string:
        #         if i in common_list:
        #             break
        #         common_list.append(i)
        #     return len(common_list)
        #
        # longest_num = 0
        # for idx, i in enumerate(s):
        #     result = find_longest_substring(idx)
        #     if result > longest_num:
        #         longest_num = result
        #
        # return longest_num

        # 3) Use hash table -> pass

        def find_longest_substring(idx):

            # common_list = []
            common_dict = {}
            common_long = 0
            string = s[idx:]
            for i in string:
                if common_dict.get(i):
                    break
                common_dict[i] = 1
                common_long += 1
            return common_long

        longest_num = 0
        for idx, i in enumerate(s):
            result = find_longest_substring(idx)
            if result > longest_num:
                longest_num = result

        return longest_num


