class Solution:
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """

        # substring_longest = 0
        # for i in range(len(s)):
        #
        #     substring_long = 0
        #     duplicate = []
        #
        #     for j in s[i:]:
        #         if j in duplicate:
        #             break
        #         substring_long += 1
        #         duplicate += j
        #     if substring_longest < substring_long:
        #         substring_longest = substring_long
        #
        # return substring_longest

        substring_longest = 0
        for i in range(len(s)):

            substring_long = 0
            duplicate = {}

            for j in s[i:]:
                if duplicate.get(j):
                    break
                substring_long += 1
                duplicate[j] = 1
            if substring_longest < substring_long:
                substring_longest = substring_long

        return substring_longest


